    deps.setDefaultBg([...deps.defaultBgBase]);
    deps.setDefaultFg([...deps.defaultFgBase]);
    deps.setSelectionColor([...deps.selectionBase]);
    deps.setCursorFallback([...deps.cursorBase]);
    deps.setActiveTheme(null);
